import React, {useState, useEffect} from 'react';
import './App.css';


function App() {

const [data, setData] = useState(null);

  useEffect(() => {
    const getData = async () => {
      await fetch('http://127.0.0.1:8000/api/groups/')
      .then( resp => resp.json())
      .then( data=> {
        setData(data);
      })
    }
    getData();
  }, [])

  return (
    <div className="App">
      <header className="App-header">

      </header>
    </div>
  )
}

export default App;
